__NUXT_JSONP__("/iam", (function(a,b,c,d,e,f,g,h,i){return {data:[{}],fetch:{"oWhoiam:0":{base:[{id:f,iam:"Ahoj, jmenuji se Michal. V osobním životě podnikám jako webový kódér ale už od mala mě to táhlo k natáčení a bavilo mě cestovat a tak jsem tyto dvě věci spojil a v roce 2018 založil Frytol na cestách. Nejdříve jsem se zaměřoval pouze na cestování ale postupně jsem začal točit i názorová videa nebo také stavění Lega.",donate:"Podpořit mě můžetě samotním sledování, odběrem a sdílením mé tvorby. Každa reakce v podobě lajku nebo komentáře je dúležitá a uspokoji algoritmus YouTube nebo jiné platformy. Pro ty ostatní co by mě chtěli podpořit finančně jsem založil Patreon.",cookies:"\u003Cp\u003ENa webu frytolnacestach.cz jsou v souladu se zákony používány cookies\u003C\u002Fp\u003E\n\n\u003Ch2\u003ECo je to cookies?\u003C\u002Fh2\u003E\n\u003Cp\u003EJako cookie (anglicky koláček, oplatka, sušenka) se v protokolu HTTP označuje malé množství dat, která WWW server pošle prohlížeči, který je uloží na počítači uživatele. Při každé další návštěvě téhož serveru pak prohlížeč tato data posílá zpět serveru. Cookies běžně slouží k rozlišování jednotlivých uživatelů, ukládají se do nich uživatelské předvolby apod., a zjednodušují tak používání webů.\u003C\u002Fp\u003E\n\n\u003Cp\u003ECookies se ukládají na straně klienta (uživatele) jako krátké textové soubory.\u003C\u002Fp\u003E\n\n\u003Cp\u003ECookies neznamenají žádné nebezpečí pro počítač jako takový. Přesto mají cookies význam pro ochranu soukromí. Navštívený web si totiž může ukládat do cookies jakékoliv informace, které o návštěvníkovi zjistí, a může tak postupně zjišťovat zájmy konkrétního návštěvníka. V žádném případě však nelze cookies použít pro zjištění totožnosti návštěvníků.\u003C\u002Fp\u003E\n\n\u003Cp\u003EInformací z cookies se dá posléze využívat pro cílenou reklamu, statistické vyhodnocování chování návštěvníků apod. Tyto informace však lze získávat i bez cookies, proto toto jejich využití nemůže být považováno za zvlášť nebezpečné.\u003C\u002Fp\u003E\n\n\u003Ci\u003EVolně čerpáno z \u003Ca href=\"https:\u002F\u002Fcs.wikipedia.org\u002Fwiki\u002FHTTP_cookie\" target=\"_blank\"\u003EWikipedie\u003C\u002Fa\u003E.\u003C\u002Fi\u003E\n\n\u003Ch2\u003EJak cookies používáme?\u003C\u002Fh2\u003E\n\u003Ch3\u003ENaše vlastní cookies\u003C\u002Fh3\u003E\n\u003Cp\u003ESlouží pro funkčnost webů. Může jít například o evidenci toho, jaké komentáře pod článkem uživatel viděl a jaké jsou pro něj nové nebo o udržování informací o přihlášení.\u003C\u002Fp\u003E\n\n\u003Ch3\u003ECookies třetích stran\u003C\u002Fh3\u003E\n\u003Cp\u003EPoužíváme i nejrůznější služby našich partnerů, kteří rovněž používají cookies. Tyto cookies jsou řízeny třetími stranami a my nemáme přístup ke čtení nebo zápisu těchto dat.\u003C\u002Fp\u003E\n\n\u003Cp\u003EJde zejména o systémy pro doručování reklamy nebo analýzy návštěvnosti.\u003C\u002Fp\u003E\n\n\u003Cspan\u003ENašimi partnery jsou:\u003C\u002Fspan\u003E\n\u003Cul\u003E\n    \u003Cli\u003E\n        Google Analytics – podrobnosti o tomto nástoji najdete \u003Ca href=\"https:\u002F\u002Fwww.google.com\u002Fintl\u002Fcs_ALL\u002Fanalytics\u002Findex.html\" target=\"_blank\"\u003Ezde\u003C\u002Fa\u003E\n    \u003C\u002Fli\u003E\n    \u003Cli\u003E\n        Google – bližší informace o pravidlech společnosti najdete \u003Ca href=\"https:\u002F\u002Fpolicies.google.com\u002Ftechnologies\u002Fads?hl=cs-cz\" target=\"_blank\"\u003Ezde\u003C\u002Fa\u003E\n    \u003C\u002Fli\u003E\n    \u003Cli\u003E\n        Sklik – bližší informace o pravidlech systému najdete \u003Ca href=\"https:\u002F\u002Fwww.sklik.cz\u002F\" target=\"_blank\"\u003Ezde\u003C\u002Fa\u003E\n    \u003C\u002Fli\u003E\n    \u003Cli\u003E\n        Facebook – bližší informace o pravidlech systému najdete \u003Ca href=\"https:\u002F\u002Fwww.facebook.com\u002Fabout\u002Fprivacy\" target=\"_blank\"\u003Ezde\u003C\u002Fa\u003E\n    \u003C\u002Fli\u003E\n\u003C\u002Ful\u003E\n\n\u003Cp\u003EZ používání určitých cookies se můžete odhlásit na výše uvedených stránkách nebo na adrese \u003Ca href=\"http:\u002F\u002Fwww.youronlinechoices.com\u002Fcz\u002Fvase-volby\" target=\"_blank\"\u003Ehttp:\u002F\u002Fwww.youronlinechoices.com\u002Fcz\u002Fvase-volby\u003C\u002Fa\u003E\u003C\u002Fp\u003E\n\n\u003Ch3\u003ESouhlas s ukládáním cookies\u003C\u002Fh3\u003E\n\u003Cp\u003EVětšina prohlížečů cookies automaticky akceptuje, pokud není prohlížeč nastaven jinak. Používáním našich webů souhlasíte s ukládáním souborů cookies.\u003C\u002Fp\u003E\n\n\u003Cp\u003EPoužití cookies můžete omezit nebo zablokovat v nastavení svého webového prohlížeče.\u003C\u002Fp\u003E\n\n\u003Ch3\u003EJak zkontrolovat nastavení cookies v různých prohlížečích\u003C\u002Fh3\u003E\n\u003Cp\u003EInformace o nastavení konkrétního prohlížeče naleznete na těchto uvedených adresách:\u003C\u002Fp\u003E\n\n\u003Cul\u003E\n    \u003Cli\u003E\n        \u003Ca href=\"https:\u002F\u002Fsupport.google.com\u002Fchrome\u002Fanswer\u002F95647?co=GENIE.Platform%3DDesktop&hl=cs\" target=\"_blank\"\u003EChrome\u003C\u002Fa\u003E\n    \u003C\u002Fli\u003E\n    \u003Cli\u003E\n        \u003Ca href=\"https:\u002F\u002Fsupport.microsoft.com\u002Fcs-cz\u002Fwindows\u002Fmicrosoft-edge-data-o-proch%C3%A1zen%C3%AD-a-ochrana-soukrom%C3%AD-bb8174ba-9d73-dcf2-9b4a-c582b4e640dd\" target=\"_blank\"\u003EEgde\u003C\u002Fa\u003E\n    \u003C\u002Fli\u003E\n    \u003Cli\u003E\n        \u003Ca href=\"https:\u002F\u002Fsupport.mozilla.org\u002Fcs\u002Fkb\u002Fvymazani-cookies-dat-stranek?redirectslug=vymazani-cookies&redirectlocale=cs\" target=\"_blank\"\u003EMozilla Firefox\u003C\u002Fa\u003E\n    \u003C\u002Fli\u003E\n    \u003Cli\u003E\n        \u003Ca href=\"https:\u002F\u002Fsupport.microsoft.com\u002Fcs-cz\u002Fwindows\u002Fodstran%C4%9Bn%C3%AD-a-spr%C3%A1va-soubor%C5%AF-cookie-168dab11-0753-043d-7c16-ede5947fc64d\" target=\"_blank\"\u003EInternet Explorer\u003C\u002Fa\u003E\n    \u003C\u002Fli\u003E\n    \u003Cli\u003E\n        \u003Ca href=\"https:\u002F\u002Fsupport.apple.com\u002Fcs-cz\u002Fguide\u002Fsafari\u002Fsfri11471\u002Fmac\" target=\"_blank\"\u003ESafari\u003C\u002Fa\u003E\n    \u003C\u002Fli\u003E\n\u003C\u002Ful\u003E",conditions:"\u003Cp\u003EOchranu osobních údajů bereme velmi vážně. Níže najdete veškeré informace o tom, jaké údaje máme k dispozici a jak s nimi nakládáme. Ochrana osobních údajů se řídí nařízením GDPR (formálně nařízení Evropského parlamentu Rady č. 2016\u002F679 ze dne 27. 4. 2016 o ochraně fyzických osob v souvislosti se zpracováním osobních údajů a o volném pohybu těchto údajů a o zrušení směrnice 95\u002F46\u002FES).\u003C\u002Fp\u003E\n\n\u003Ch2\u003EKdo jsem a jak mě můžete kontaktovat:\u003C\u002Fh2\u003E\n\u003Cp\u003E\nMichal Fryč\u003Cbr\u003E\nVrchlického 995,\u003Cbr\u003E\nRoudnice nad Labem\u003Cbr\u003E\n413 01\u003Cbr\u003E\nTEL: +420 722 678 090\u003Cbr\u003E\nIČO: 04521587\u003Cbr\u003E\nFyzická osoba podnikající dle živnostenského zákona nezapsaná v obchodním rejstříku od 29. října 2015\n\u003C\u002Fp\u003E\n\n\u003Ch2\u003EZpracováváme tyto osobní údaje:\u003C\u002Fh2\u003E\n\u003Cp\u003EŽádné\u003C\u002Fp\u003E\n\n\u003Ch2\u003EÚčel a doba zpracování:\u003C\u002Fh2\u003E\n\u003Cp\u003EZatím nic nezpracováváme pouze v rámci cookies a třetích stran\u003C\u002Fp\u003E\n\n\u003Ch2\u003EZpracovatelé:\u003C\u002Fh2\u003E\n\u003Cp\u003EAbychom vám nabízeli špičkové služby, využíváme služby třetích stran. Níže najdete jejich jmenovitý seznam. Využíváme i zpracovatele mimo evropskou unii, konkrétně využíme software u USA. Předání údajů proběhne na základě ověření zpracovatele platformou Privacy Shield. (Tato platforma kontroluje, zda je americký software v souladu s evropskou legislativou.)\u003C\u002Fp\u003E\n\u003Cul\u003E\n    \u003Cli\u003EPoskytovatel softwaru Google LLC.\u003C\u002Fli\u003E\n    \u003Cli\u003EPoskytovatel hostingu FORPSI provozovatel INTERNET CZ, a. s.,\u003C\u002Fli\u003E\n    \u003Cli\u003EPřípadně další poskytovatelé zpracovatelských softwarů, služeb a aplikací, které však v současné době společnost nevyužívá.\u003C\u002Fli\u003E\n\u003C\u002Ful\u003E\n\n\u003Ch2\u003ECookies\u003C\u002Fh2\u003E\n\u003Cp\u003ENa webových stránkách využíváme cookies. Analytické cookies, které měří návštěvnost těchto stránek, považujeme za nás oprávněný zájem. Cookies pro cílení reklamy zpracováváme jen na základě vašeho souhlasu. Používání cookies můžete na svém počítači zakázat. Více o fungování cookies najdete zde.\u003C\u002Fp\u003E\n\n\u003Ch2\u003EZabezpečení a ochrana osobních údajů\u003C\u002Fh2\u003E\n\u003Cp\u003EPřijímáme veškerá technická a organizační opatření k zabezpečení ochrany osobních údajů způsobem uvedeným v Zákoně nebo v jiných závazných právních předpisech a k vyloučení možnosti neoprávněného nebo nahodilého přístupu k osobním údajům, k jejich změně, zničení či ztrátě, neoprávněným přenosům, k jejich jinému neoprávněnému zpracování, jakož i k jinému zneužití osobních údajů. Tato povinnost platí i po ukončení zpracování osobních údajů.\u003C\u002Fp\u003E\n\n\u003Cp\u003EVeškerá elektronická data uložená chráníme zabezpečeným protokolem (HTTPS šifrovaný pomocí TLS), který chrání spojení vašeho webového prohlížeče a našeho serveru před odposloucháváním a podvrhy dat.\u003C\u002Fp\u003E\n\n\u003Ch2\u003EVaše práva:\u003C\u002Fh2\u003E\n\u003Cp\u003ENa základě nařízení GDPR máte tato práva:\u003C\u002Fp\u003E\n\u003Cul\u003E\n    \u003Cli\u003Evzít souhlas kdykoli zpět;\u003C\u002Fli\u003E\n    \u003Cli\u003Epožadovat po nás informace o zpracování osobních údajů;\u003C\u002Fli\u003E\n    \u003Cli\u003Epožadovat po nás přístup k osobním údajům;\u003C\u002Fli\u003E\n    \u003Cli\u003Epožadovat po nás opravu nepřesných osobních údajů, jejich doplnění či aktualizaci;\u003C\u002Fli\u003E\n    \u003Cli\u003Epožadovat po nás bezodkladný výmaz osobních údajů;\u003C\u002Fli\u003E\n    \u003Cli\u003Epožadovat po nás omezení zpracování osobních údajů;\u003C\u002Fli\u003E\n    \u003Cli\u003Epožádat nás o přenos osobních údajů ve strojově čitelném formátu;\u003C\u002Fli\u003E\n    \u003Cli\u003Ev případě pochybností o zákonnost zpracování vašich osobních údajů máte právo obrátit se na Úřad pro ochranu osobních údajů.\u003C\u002Fli\u003E\n\u003C\u002Ful\u003E"}]},"oPlatform:0":{platforms:[{id:f,slug:"tiktok",name:"TikTok",perex:"Ten kdo řiká, že je TikTok na nic je podle mě Boomer. I na této síťi se dá dělat kvalitní obsah. Osobně jsem si ho založil z důvodů tvorby skečů. První video, které jsem zde nahrál mělo během prvního týdne 200 tisíc zobrazení.",url:"https:\u002F\u002Fwww.tiktok.com\u002F@frytol_na_cestach",facts:[{name:a,value:"Listopad 2020"},{name:b,value:"1200"}],date:c},{id:2,slug:"youtube",name:"Youtube",perex:"Youtube byla první platforma kterou jsem založil pro \"značku\" Frytol na cestách. Stále ho beru jako hlavní komunikační kanál pro mojí tvorbu.",url:"https:\u002F\u002Fyoutube.com\u002F@frytolnacestach",facts:[{name:a,value:d},{name:"Odběratelů",value:"632"}],date:g},{id:3,slug:"instagram",name:"Instagram",perex:"Na instagramu zvěřejnuji jak fotografie z míst kde jsem byl, tak také zde můžetě vidět kde zrovna jsem. Tedy pokud zrovna něco sdílím.",url:"https:\u002F\u002Fwww.instagram.com\u002Ffrytolnacestach\u002F",facts:[{name:a,value:d},{name:b,value:"413"}],date:g},{id:4,slug:"facebook",name:"Facebook",perex:"Na Facebooku většinou pouze zveřejnuji příspěvky o vydaní nového videa a také se tam sdílí obsah z mého Instagramu.",url:"https:\u002F\u002Fwww.facebook.com\u002Ffrytolnacestach",facts:[{name:a,value:d},{name:b,value:"197"}],date:c},{id:5,slug:"twitter",name:"Twitter",perex:"Síť, na které se většinou vyjadřuji k věcem co mě štvou, trápí nebo mě potěší.",url:"https:\u002F\u002Ftwitter.com\u002Ffrytolnacestach",facts:[{name:a,value:h},{name:b,value:"9"}],date:c},{id:6,slug:"twitch",name:"Twitch",perex:"Jasně mám i Twitch jednou jsem i Stremoval asi tak 5 minut než jsem to vypnul ale to neznamená že někdy tam něco nebudu vysílat.",url:"https:\u002F\u002Fwww.twitch.tv\u002Ffrytolnacestach",facts:[{name:a,value:"Leden 2019"},{name:b,value:"1"}],date:c},{id:7,slug:"reddit",name:"Reddit",perex:"Zatím ho nevyužívám ale jednou se může hodit!",url:"https:\u002F\u002Fwww.reddit.com\u002Fuser\u002FFrytolNaCestach",facts:[{name:a,value:i}],date:e},{id:8,slug:"pinterest",name:"Pinterest",perex:"Zatím ho nevyužívám ale jednou se může hodit, možná!",url:"https:\u002F\u002Fcz.pinterest.com\u002Ffrytolnacestach\u002F",facts:[{name:a,value:i}],date:e},{id:9,slug:"discord",name:"Discord",perex:"Zde mi můžete třeba napsat, a můžeme rozebrat nějaké téma veřejne.",url:"https:\u002F\u002Fdiscord.com\u002Fchannels\u002F610780694096117760\u002F610780694096117762",facts:[{name:a,value:d}],date:e},{id:10,slug:"patreon",name:"Patreon",perex:"Na téhle platformě budu v budoucnu žebrat peníze. Sranda! Ale kdyby jste se chtěli stát mím Patronem, tak hůrá do tohe a díky!",url:"https:\u002F\u002Fwww.patreon.com\u002Ffrytolnacestach",facts:[{name:a,value:h}],date:e}]}},mutations:void 0}}("Založeno","Sledující","k 13. Říjnu 2022","Srpen 2018","",1,"k 17. Říjnu 2022","Duben 2019","Srpen 2022")));